import GetProductos from './components/GetProductos';
import CrearProducto from './components/CrearProducto';
import EditarProducto from './components/EditarProducto';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import React, { Fragment } from 'react'; //importo para poder usar el fragment 
//el fragment es un componente que no se renderiza pero que me permite agrupar elementos



function App() {
  return (

    <Fragment>
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <div className="container-fluid">
          <a className="navbar-brand" href="/">Veterinaria</a>
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup"
            aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation"> <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
            </div>
        </div>
      </nav>
    </Fragment>


  );
}

export default App;
